import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TopBanner from "./pages/index.js";
import Podcast from "./pages/podcast";
import MovieList from "./pages/movies";
//above is how you can import a function from a different file

function Nav() {
  return (
    <>
      <div>
        <a href="https://baconsale.com/">Visit Joel's Podcast!</a>
      </div>
    </>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<TopBanner />} />
        <Route path="/podast" element={<Podcast />} />
        <Route path="/movies" element={<MovieList />} />
      </Routes>
    </Router>
  );
}

export default App;
